INSERT INTO `section` VALUES (71, 'KB0 L21', 1, NULL, '2020-09-29 16:56:08', '2020-09-29 16:56:08', '', '', '<p><strong>Key Words(重点词汇)</strong></p>\r\n<p>he, she</p>\r\n<p><strong>Key Sentences</strong><strong>(重点句子)</strong></p>\r\n<p>He\'s a boy.</p>\r\n<p>She\'s a girl.</p>\r\n<p><strong>Q</strong>: How old is he/she?&nbsp;</p>\r\n<p><strong>A</strong>: He/She is ...years old.&nbsp;</p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/5ee23d68a62f350b2834b9f6da1fff68.jpg\" /></p>', '<p>参照外教的视频练习图片中的内容，并将练习内容以录音形式提交（点击加号提交录音，老师会对提交的内容进行点评）</p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/d59c5c80972eaacfc922c07bbfa48743.png\" /></p>\r\n<p><video controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"../../up/20201127/de4b0778d9c41e0645d21b6a42f18593.mp4\" type=\"video/mp4\" /></video></p>');
INSERT INTO `section` VALUES (72, 'KB0 L22', 1, NULL, '2020-09-29 16:56:47', '2020-09-29 16:56:47', '', '', '<p><strong>Key Words(重点词汇)</strong></p>\r\n<p>in, on, under</p>\r\n<p><strong>Key Sentences(重点句子)</strong></p>\r\n<p><strong>Q</strong>: Where is the (...)?</p>\r\n<p><strong>A</strong>: It\'s (in/on/under) the (...).</p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/759a8b22f197c88a87d5e13054c0105b.jpg\" /></p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/50dd14169bf8799a8a5927aedfe11f40.jpg\" /></p>', '<p>参照外教的视频练习图片中的内容，并将练习内容以录音形式提交（点击加号提交录音，老师会对提交的内容进行点评）</p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/5b48f8b47aecf7d9054cada11d03bcc6.png\" /></p>\r\n<p><video controls=\"controls\" width=\"350\" height=\"175\">\r\n<source src=\"../../up/20201127/65a58bf340cefcc92e85a31e83b335b4.mp4\" type=\"video/mp4\" /></video></p>');
