INSERT INTO `section` VALUES (105, 'KB1 L21', 9, NULL, '2020-09-29 17:28:20', '2020-09-29 17:28:20', '', '', '<p><strong>Key Words(重点词汇)</strong></p>\r\n<p>in, on, under</p>\r\n<p><strong>Key SentenceS(重点句子)</strong></p>\r\n<p><strong>Q</strong>: Where is the (...)</p>\r\n<p><strong>A</strong>: It\'s (in/on/under) the ...</p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/d5f1096e28acd931fd395d87edadfffb.jpg\" /></p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/229d0a5005f3570dc192aadbeeac3740.jpg\" /><img style=\"width: 100%;\" src=\"../../up/attach/20201127/e909eb2fddbf30355372dc1a4e5140cb.jpg\" /><img style=\"width: 100%;\" src=\"../../up/attach/20201127/6b5700f6f33c8ed45901d3c372fcff3b.jpg\" /></p>', '<p>参照外教的视频练习图片中的内容，并将练习内容以录音形式提交（点击加号提交录音，老师会对提交的内容进行点评）</p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/d0efc58d820abe453e7c12b1aebca197.jpg\" /></p>\r\n<p><video controls=\"controls\" width=\"350\" height=\"175\">\r\n<source src=\"../../up/20201127/26995df97e79c02ed55a6ed71764bf2a.mp4\" type=\"video/mp4\" /></video></p>');
INSERT INTO `section` VALUES (106, 'KB1 L22', 9, NULL, '2020-09-29 17:28:56', '2020-09-29 17:28:56', '', '', '<p><strong>Key Words</strong><strong>(重点词汇)</strong></p>\r\n<p>behind, in front of</p>\r\n<p><strong>Key Sentences</strong><strong>(重点句子)</strong></p>\r\n<p><strong>Q</strong>: Where is the (...)?</p>\r\n<p><strong>A</strong>: The (...) is (behind/ in front of) the (...).</p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/4523fe08f4ef08873e6aee2f69de21ab.jpg\" /></p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/12608c9414028755401ce6924cf8ded4.jpg\" /></p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/e4ec6ae3b999836f6e4a32b33dc632f1.jpg\" /></p>', '<p>参照外教的视频练习图片中的内容，并将练习内容以录音形式提交（点击加号提交录音，老师会对提交的内容进行点评）</p>\r\n<p><img style=\"width: 100%;\" src=\"../../up/attach/20201127/0c5108f7974a38fee4152905af250e8c.jpg\" /></p>\r\n<p><video controls=\"controls\" width=\"350\" height=\"175\">\r\n<source src=\"../../up/20201127/9190386621dcaf1dc1dec35092be09b6.mp4\" type=\"video/mp4\" /></video></p>');
